import React,{useContext} from 'react';
import {Link,useNavigate} from 'react-router-dom';
import { UserContext } from '../App';
const Navbar = () => {
        const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [user, setUser] = useState()

    const handleSubmit = async e => {
        
    };


    const navigate = useNavigate()
    const {state,dispatch} = useContext(UserContext)
    const reload=()=>{
            setUser({});
        setUsername("");
        setPassword("");
        localStorage.clear();
    }
    const renderList1=()=>{
        if(state){
            return[
                <Link to="/" className="brand-logo">mYeat</Link>
            ]
        }
        else{
            return[
                <Link to="/home" className="brand-logo">mYeat</Link>
            ]
        }
    }
    const renderList2=()=>{
        if(state){
            return[
                <li onClick={reload}><Link to="/" >Sign Out</Link></li>,
                <li><Link to="/profile"><i class="large material-icons">account_circle</i></Link></li>               
            ]
        }
        else{
            return[
                <li><Link to="/signin" className="signin" >Sign In</Link></li>,
                <li><Link to="/signup">Sign Up</Link></li>
            ]
        }
    }

    return (
        <nav>
            <div className="nav-wrapper">
                {renderList1()}
                
                <ul id="nav-mobile" className="right">
                    {renderList2()}
                </ul>
            </div>
        </nav>
    );
}
export default Navbar;
